import React from "react";
import { Tile } from '../tile/Tile'

export const TileList = ({ items }) => {
  return (
    <div className="tile-list">
      {items.map(({ name, ...rest}, index) => (
        <Tile key={index} name={name} description={index}/>
      ))}
    </div>
  );
};
